import {BrowseRouter,Routes,Route} from "react-router-dom"
import './App.css';
import Signup from './pages/signup';
function App() {
  return (
    
    <div className="App">
      <BrowseRouter>
        <Routes>
          <Route path="/" element="{<Signup/>}"/>
        </Routes>
      </BrowseRouter>
    </div>
  );
}

export default App;
